System designers started to invent hardware support for locking. The test-and-set instruction is one implementation of this hardware support. In this example we see test-and-set in practice via C code: int TestAndSet(int *old_ptr, int new) { int old = *old_ptr; // Fetch old value at old ptr; *old_ptr = new; // Store 'new' into old_ptr return old; // return the old value
} typedef struct __lock_t { int flag;
} lock_t; void init(lock_t *lock) { // 0: lock is available, 1: lock is held lock->flag = 0;
} void lock(lock_t *lock) { while (TestAndSet(&lock->flag, 1) == 1) ; // spin-wait (do nothing)
} void unlock(lock_t *lock) { lock->flag = 0;
} First case, a thread calls lock: No other threads currently holds the lock (thus flag is 0). Thread calls TestAndSet(flag, 1), which returns the old value (0) The thread breaks the loop since the returned value is 0 The thread also atomically set the value of flag to 1 thus indicating that the thread is now held We the threads finishes execution of the critical section, unlock is called. The second case is: Other thread already has the lock held (flag is 1) Another thread calls TestAndSet(flag, 1) TestAndSet returns the old values which is 1, while simultaneously setting it to 1 again As long as other threads holds the lock, 1 will be returned and thus this thread will spin and spin until the lock is finally released. This TestAndSet is actually an atomtic instruction implemented on the hardware level, hence it can't be interrupted. Hence we ensure that only one thread acquire the lock.

